import Button from './Button'
const title='hi'
const Header = ({title}) => {
    const onClick= () => {
        console.log('Click')
    }

    return (
        <header className='header'>
            <h1>{title}</h1>
            <Button color='green' text='ADD' onClick={onClick} />
        </header>
    )
}
Header.defaultProps= {
    title:'Task-tracker',
}

export default Header
